import React from 'react'
import Video from '../../videos/video'

const HeroSection = () => {
    return (
        <Herocontainer>
            <Herobg>
                <Videobg autoPlay loop muted src={video} type='video/mp4'></Videobg>
            </Herobg>
        </Herocontainer>
    )
}

export default HeroSection
